const ReviewListItem = ({review}) => {
  return(
      <div>
          <div className="p-3 row">
              <img className="wd-rounded-corners col-1" height="50" width="50" src={review.profilePicture}/>
              <div className="col-11 wd-bolded-font wd-font-white">
                  {review.user}
              </div>
          </div>
        {review.review}

      </div>
  )
}

export default ReviewListItem;
